  // CASE 5: !S[1] && S[0] && !included S[0]
  // CASE 6: !S[1] && S[0] && included S[0]
function lengthOfLongestSubstring(s: string): number {
  let substring = '';
  let max = 0;
  for (let i = 0; i < s.length; i++) {
    if (substring.indexOf(s[i]) >= 0) {
      substring = substring.slice(substring.indexOf(s[i])+1, substring.length)
    }
    substring += s[i]
    max = substring.length > max ? substring.length : max
  }
  return max
};

